-- Creating a database
CREATE DATABASE World_Job_Market_Insights;

-- Using the database
USE World_Job_Market_Insights;

-- 1.Creating the first table to store countries information:
CREATE TABLE Countries (
iso_alpha2 VARCHAR(2) PRIMARY KEY,
country_name VARCHAR(40),
iso_alpha3 VARCHAR(3),
gender_Pay FLOAT,
population INT,
Area_in_km2 NUMERIC(9, 1),
continent VARCHAR(2),
currency_code VARCHAR(4)
);

-- 2.Creating the second table to store job details:
CREATE TABLE Jobs (
    Job_id VARCHAR(200),
    iso_alpha2 CHAR(2), 
    Job_title VARCHAR(200),
    PRIMARY KEY (Job_id, iso_alpha2)
);

-- 3.Creating the third table to store salaries details:
CREATE TABLE Salaries (
    Salary_id INT PRIMARY KEY,
    iso_alpha2 CHAR(2),
    Job_id VARCHAR(200),
    percentile_25 FLOAT,
    percentile_25_GBP FLOAT,
    percentile_50 FLOAT,
    percentile_50_GBP FLOAT,
    percentile_75 FLOAT,
    percentile_75_GBP FLOAT,
	FOREIGN KEY (iso_alpha2) REFERENCES countries (iso_alpha2),
    FOREIGN KEY (Job_id) REFERENCES Jobs (Job_id)
);


